insert into InsuranceType values ('Compulsory civil liability insurance', 800, '<div>Compulsory civil liability insurance of car owners is a type of compulsory car insurance prescribed by Vietnamese law, where the owner is an individual or an organization owning a car, even a Vietnamese national or foreign must participate. Car owners must have this type of insurance to ensure that the interests of a third party (who is in a collision with the vehicle) are supported and that the driver is responsible when causing damage.</div><div><br></div><div><b>Scope of compensation for damage of insurance</b></div><div><br></div><ol><li>Damages to the body and life of passengers under the contract of carriage of passengers caused by automobiles.</li><li>Extra-contractual damage to body, life and property to a third party caused by a car.</li></ol><div><br></div><div><b>Limit of liability insurance pays</b></div><div><br></div><ol><li>For human damage: 100 million VND/1 person/1 accident.</li><li>For property damage: 50 million VND/1 accident.</li></ol>'),
								('Accident insurance for driver, assistant and occupants', 600, '<div>This is a form of voluntary insurance for the driver and the people sitting in the car when they lose their life and body due to a traffic accident.</div><div><br></div><div><b>Scope of compensation for damage of insurance</b></div><div><br></div><ol><li>The insurance company will pay damages for bodily injury or death to the insured while in the vehicle, when getting on or when getting off the vehicle while the vehicle is in traffic. The auto insurance premium and the insurance amount will be stated in the contract agreed between the car owner and the insurance company.<br></li></ol><div><br></div><div><b>Limit of liability insurance pays</b></div><div><br></div><ol><li>For human damage: 40 million VND/1 person/1 accident.</li><li>For property damage: 20 million VND/1 accident.</li></ol>'),
								('Material insurance car', 400, '<div>Automobile physical insurance (car body insurance) is a voluntary insurance that has the role of protecting the body and machinery and equipment of the car. Accordingly, when a traffic accident occurs, the insurance service side will support the cost to overcome damages such as scratches, dents, fire, explosion, theft,...</div><div><br></div><div><b>Scope of compensation for damage of insurance</b></div><div><b><br></b></div><ol><li>Unexpected accidents, beyond the control of the vehicle owner in the following cases: Crashing, overturning, falling, falling, sinking, burning, exploding, being hit by other objects.</li><li>Theft, theft of the entire vehicle (full compensation).</li><li>In particular, compensation for the entire vehicle if the damage is over 75% or to the extent that it cannot be repaired or restored to ensure safe circulation, or the cost of restoration is equal to or greater than the actual value of the vehicle.</li></ol><div><br></div><div><b>Limit of liability insurance pays</b></div><div><br></div><ol><li>For human damage: 50 million VND/1 person/1 accident.</li><li>For property damage: 30 million VND/1 accident.</li></ol>'),
								('Voluntary civil liability insurance', 200, '<div>Coverage represents additional liability beyond the state-mandated insurance coverage that car owners wish to participate in. The insurance company will return the difference in the amount the car owner has compensated the victim based on the extent of fault in the accident and the amount the car owner participates in insurance.</div>'),
								('Cargo civil liability insurance', 300, '<div>Cargo civil liability insurance is a type of insurance that is often used by organizations and individuals with business lines, transporting goods because they are intended to support vehicle owners in the event of an accident, damage cargo damage, due to other external factors such as landslides, storms, floods, etc. during the transportation of goods on the vehicle. The insurance company will pay the car owner the insurance amount that the car owner has to pay for damage to transported goods in accordance with the provisions of the Civil Law.</div><div><br></div><div><b>Scope of compensation for damage of insurance</b></div><div><b><br></b></div><ol><li>Damages to goods due to accidents that are determined to be caused by the fault of the vehicle owner during the transportation of goods.<br></li></ol><div><br></div><div><b>Limit of liability insurance pays</b></div><div><br></div><ol><li>Ranging from 10 million VND/ton to 50 million VND/ton.</li><li>The insurance company will pay for an accident equal to: The level of insurance liability x The load of the goods is damaged.</li></ol>'),
								('Two-way auto insurance', 250, '<div>This is an unofficial call of the insurance that will be paid to any accident. Two-way auto insurance consists of two types: Civil liability insurance car and Material insurance car.</div>')
