create database VehicleInsurance
use VehicleInsurance

create table Customer (CustomerID int identity(1, 1) primary key not null,
						Username varchar(50) unique not null,
						[Password] varchar(50) not null,
						CustomerName varchar(100) not null,
						CustomerADD varchar(200) not null,
						CustomerPhoneNumber int not null,
						Email varchar(70) not null,
						CitizenIdentityCard bigint not null,
						[Status] varchar(50) not null)

create table Feedback (FeedbackID int identity(1, 1) primary key not null,
						CustomerID int foreign key references Customer(CustomerID) not null,
						[Description] varchar(200) not null,
						[Datetime] datetime not null,
						[Type] varchar(50) not null,
						[Status] varchar(50) not null)

create table VehicleType (VehicleTypeID int identity(1, 1) primary key not null,
							VehicleTypeName varchar(50) not null)

create table VehicleBrand (VehicleBrandID int identity(1, 1) primary key not null,
							VehicleBrandName varchar(50) not null)

create table VehicleModel (VehicleModelID int identity(1, 1) primary key not null,
							VehicleBrandID int foreign key references VehicleBrand(VehicleBrandID) not null,
							VehicleModelName varchar(50) not null)

create table Vehicle (VehicleID int identity(1, 1) primary key not null,
						VehicleTypeID int foreign key references VehicleType(VehicleTypeID) not null,
						VehicleModelID int foreign key references VehicleModel(VehicleModelID) not null,
						CustomerID int foreign key references Customer(CustomerID) not null,
						VehicleOwnerName varchar(100) not null,
						VehicleBodyNumber varchar(50) not null,
						VehicleEngineNumber varchar(50) not null,
						VehicleNumber varchar(50) not null,
						[Image] varbinary(max) not null,
						SeatNumber int not null,
						[Status] varchar(50) not null)

create table InsuranceType (InsuranceTypeID int identity(1, 1) primary key not null,
							InsuranceTypeName varchar(150) not null,
							Price money not null,
							[Description] varchar(max) not null)

create table OrderPolicy (PolicyNumber int identity(1, 1) primary key not null,
							VehicleID int foreign key references Vehicle(VehicleID) not null,
							InsuranceTypeID int foreign key references InsuranceType(InsuranceTypeID) not null,
							InsurancePrice money not null,
							OrderDate datetime not null,
							PolicyDate date not null,
							PolicyDuration int not null,
							PaymentType varchar(50) not null,
							[Status] varchar(50) not null)

create table Bill (BillNo int identity(1, 1) primary key not null,
					PolicyNumber int foreign key references OrderPolicy(PolicyNumber) not null,
					ActualDatetime datetime null,
					ExpectedDate date not null,
					Amount money not null,
					[Status] varchar(50) not null)

create table Claim (ClaimNumber int identity(1, 1) primary key not null,
					PolicyNumber int foreign key references OrderPolicy(PolicyNumber) not null,
					PlaceOfAccident varchar(200) not null,
					DateOfAccident date not null,
					InsuredAmount money null,
					ClaimableAmount money not null,
					[Status] varchar(50) not null)

create table CompanyExpense (CompanyExpenseID int identity(1, 1) primary key not null,
							DateOfExpense date not null,
							TypeOfExpense varchar(100) not null,
							AmountOfExpense money not null)

create table Coefficient (CoefficientID int identity(1, 1) primary key not null,
							SeatNumber int not null,
							Coefficient decimal(2, 1) not null)

create table Employee (EmployeeID int identity(1, 1) primary key not null,
						Username varchar(50) unique not null,
						[Password] varchar(50) not null,
						EmployeeName varchar(100) not null,
						EmployeeADD varchar(200) not null,
						EmployeePhoneNumber int not null,
						Email varchar(70) not null)
						
